import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import { Parallax, ParallaxBanner } from 'react-scroll-parallax';



function MainSlider() {
  return (
      <div className="slider">

        <Carousel
        >
          <Carousel.Item>
          <ParallaxBanner
      className="slide_img"
      layers={[
          {
              image: '/images/slides/slide_2.png',
              amount: 0.4,
          },
      ]}
      style={{
          height: '100vh',
      }}
  >
      <h1>Banner Children</h1>
  </ParallaxBanner>
          </Carousel.Item>


          <Carousel.Item>
          <Parallax
                offsetYMin={-100}
                offsetYMax={100}
                className="slide_img"
            >
            <img src="/images/slides/slide_2.png" />
            </Parallax>
          </Carousel.Item>


          <Carousel.Item>
          <Parallax
                offsetYMin={-100}
                offsetYMax={100}
                className="slide_img"
            >
            <img src="/images/slides/slide_2.png" />
            </Parallax>
          </Carousel.Item>
        </Carousel>
      </div>
  );
}

export default MainSlider;
